import { isKeyValueObject } from "../../victory-util/type-helpers";
export function getAxisData(data, axis) {
  return data.reduce(function (acc, datum) {
    if (isKeyValueObject(datum)) {
      var value = datum[axis];

      if (value && typeof value !== "string") {
        acc.push(value);
      }
    }

    return acc;
  }, []);
}
